import { useState } from "react";
import { useEffect } from "react";
function ContactUs() {
  return (
    <>
      <form action="">
        <input
          type="text"
          name=""
          id=""
          placeholder="Name"
          className="form-control"
        />
        <input type="number" className="form-" />
      </form>
    </>
  );
}
export default ContactUs;
